  // Assume you have state for the access token here

  return (
    <Router>
      <Switch>
        <Route path="/login" component={Login} />
        <Route path="/" exact component={Home} />
        <Route path="/recent" render={() => <RecentlyPlayed accessToken={yourAccessToken} />} />
        <Route path="/top" render={() => <TopArtists accessToken={yourAccessToken} />} />
        {/* Add more routes as needed */}
      </Switch>
    </Router>
  );
};

export default App;
